        const double crRightHandSideVector2 = DN(2,1)*u(2,0);
        const double crRightHandSideVector3 = crRightHandSideVector0 + crRightHandSideVector1 + crRightHandSideVector2;
        const double crRightHandSideVector4 = DN(0,0)*u(0,0);
        const double crRightHandSideVector5 = DN(1,0)*u(1,0);
        const double crRightHandSideVector6 = DN(2,0)*u(2,0);
        const double crRightHandSideVector7 = crRightHandSideVector4 + crRightHandSideVector5 + crRightHandSideVector6;
        const double crRightHandSideVector8 = crRightHandSideVector7 + 1;
        const double crRightHandSideVector9 = S[0]*crRightHandSideVector8 + S[2]*crRightHandSideVector3;
        const double crRightHandSideVector10 = S[1]*crRightHandSideVector3 + S[2]*crRightHandSideVector8;
        const double crRightHandSideVector11 = DN(0,0)*u(0,1);
        const double crRightHandSideVector12 = DN(1,0)*u(1,1);
        const double crRightHandSideVector13 = DN(2,0)*u(2,1);
        const double crRightHandSideVector14 = crRightHandSideVector11 + crRightHandSideVector12 + crRightHandSideVector13;
