        const double crRightHandSideVector17 = DN(1,1)*u(1,1);
        const double crRightHandSideVector18 = DN(2,1)*u(2,1);
        const double crRightHandSideVector19 = crRightHandSideVector16 + crRightHandSideVector17 + crRightHandSideVector18;
