        const double crLeftHandSideMatrix11 = std::pow(crLeftHandSideMatrix10, 2);
        const double crLeftHandSideMatrix12 = DN(0,0)*u(0,0);
        const double crLeftHandSideMatrix13 = DN(1,0)*u(1,0);
        const double crLeftHandSideMatrix14 = DN(2,0)*u(2,0);
        const double crLeftHandSideMatrix15 = DN(3,0)*u(3,0);
        const double crLeftHandSideMatrix16 = crLeftHandSideMatrix12 + crLeftHandSideMatrix13 + crLeftHandSideMatrix14 + crLeftHandSideMatrix15;
        const double crLeftHandSideMatrix17 = crLeftHandSideMatrix16 + 1;
        const double crLeftHandSideMatrix18 = std::pow(crLeftHandSideMatrix17, 2);
        const double crLeftHandSideMatrix19 = crLeftHandSideMatrix11 + crLeftHandSideMatrix18 + crLeftHandSideMatrix5;
        const double crLeftHandSideMatrix20 = C(0,0)*crLeftHandSideMatrix19;
        const double crLeftHandSideMatrix21 = DN(0,1)*u(0,0);
        const double crLeftHandSideMatrix22 = DN(1,1)*u(1,0);
        const double crLeftHandSideMatrix23 = DN(2,1)*u(2,0);
        const double crLeftHandSideMatrix24 = DN(3,1)*u(3,0);
