        const double crLeftHandSideMatrix32 = std::pow(crLeftHandSideMatrix31, 2);
        const double crLeftHandSideMatrix33 = DN(0,1)*u(0,1);
        const double crLeftHandSideMatrix34 = DN(1,1)*u(1,1);
        const double crLeftHandSideMatrix35 = DN(2,1)*u(2,1);
        const double crLeftHandSideMatrix36 = DN(3,1)*u(3,1);
        const double crLeftHandSideMatrix37 = crLeftHandSideMatrix33 + crLeftHandSideMatrix34 + crLeftHandSideMatrix35 + crLeftHandSideMatrix36;
