        const double crLeftHandSideMatrix43 = DN(1,2)*u(1,0);
        const double crLeftHandSideMatrix44 = DN(2,2)*u(2,0);
        const double crLeftHandSideMatrix45 = DN(3,2)*u(3,0);
        const double crLeftHandSideMatrix46 = crLeftHandSideMatrix42 + crLeftHandSideMatrix43 + crLeftHandSideMatrix44 + crLeftHandSideMatrix45;
        const double crLeftHandSideMatrix47 = std::pow(crLeftHandSideMatrix46, 2);
        const double crLeftHandSideMatrix48 = DN(0,2)*u(0,1);
        const double crLeftHandSideMatrix49 = DN(1,2)*u(1,1);
        const double crLeftHandSideMatrix50 = DN(2,2)*u(2,1);
        const double crLeftHandSideMatrix51 = DN(3,2)*u(3,1);
        const double crLeftHandSideMatrix52 = crLeftHandSideMatrix48 + crLeftHandSideMatrix49 + crLeftHandSideMatrix50 + crLeftHandSideMatrix51;
        const double crLeftHandSideMatrix53 = std::pow(crLeftHandSideMatrix52, 2);
        const double crLeftHandSideMatrix54 = DN(0,2)*u(0,2);
        const double crLeftHandSideMatrix55 = DN(1,2)*u(1,2);
        const double crLeftHandSideMatrix56 = DN(2,2)*u(2,2);
        const double crLeftHandSideMatrix57 = DN(3,2)*u(3,2);
        const double crLeftHandSideMatrix58 = crLeftHandSideMatrix54 + crLeftHandSideMatrix55 + crLeftHandSideMatrix56 + crLeftHandSideMatrix57;
        const double crLeftHandSideMatrix59 = crLeftHandSideMatrix58 + 1;
        const double crLeftHandSideMatrix60 = std::pow(crLeftHandSideMatrix59, 2);
        const double crLeftHandSideMatrix61 = crLeftHandSideMatrix47 + crLeftHandSideMatrix53 + crLeftHandSideMatrix60;
        const double crLeftHandSideMatrix62 = C(0,2)*crLeftHandSideMatrix61;
        const double crLeftHandSideMatrix63 = crLeftHandSideMatrix10*crLeftHandSideMatrix31;
        const double crLeftHandSideMatrix64 = crLeftHandSideMatrix38*crLeftHandSideMatrix4;
        const double crLeftHandSideMatrix65 = crLeftHandSideMatrix17*crLeftHandSideMatrix25;
        const double crLeftHandSideMatrix66 = crLeftHandSideMatrix63 + crLeftHandSideMatrix64 + crLeftHandSideMatrix65;
        const double crLeftHandSideMatrix67 = 2*crLeftHandSideMatrix66;
        const double crLeftHandSideMatrix68 = crLeftHandSideMatrix25*crLeftHandSideMatrix46;
        const double crLeftHandSideMatrix69 = crLeftHandSideMatrix31*crLeftHandSideMatrix59;
        const double crLeftHandSideMatrix70 = crLeftHandSideMatrix38*crLeftHandSideMatrix52;
        const double crLeftHandSideMatrix71 = crLeftHandSideMatrix68 + crLeftHandSideMatrix69 + crLeftHandSideMatrix70;
        const double crLeftHandSideMatrix72 = 2*crLeftHandSideMatrix71;
        const double crLeftHandSideMatrix73 = crLeftHandSideMatrix4*crLeftHandSideMatrix52;
        const double crLeftHandSideMatrix74 = crLeftHandSideMatrix10*crLeftHandSideMatrix59;
        const double crLeftHandSideMatrix75 = crLeftHandSideMatrix17*crLeftHandSideMatrix46;
        const double crLeftHandSideMatrix76 = crLeftHandSideMatrix73 + crLeftHandSideMatrix74 + crLeftHandSideMatrix75;
        const double crLeftHandSideMatrix77 = 2*crLeftHandSideMatrix76;
        const double crLeftHandSideMatrix78 = C(0,3)*crLeftHandSideMatrix67 + C(0,4)*crLeftHandSideMatrix72 + C(0,5)*crLeftHandSideMatrix77 + crLeftHandSideMatrix20 + crLeftHandSideMatrix41 + crLeftHandSideMatrix62;
