        const double crLeftHandSideMatrix87 = crLeftHandSideMatrix86*tau_th;
        const double crLeftHandSideMatrix88 = 0.33333333333333331*crLeftHandSideMatrix87;
        const double crLeftHandSideMatrix89 = crLeftHandSideMatrix79*crLeftHandSideMatrix88;
        const double crLeftHandSideMatrix90 = DN(0,0)*crLeftHandSideMatrix34;
        const double crLeftHandSideMatrix91 = DN(0,0)*crLeftHandSideMatrix55;
        const double crLeftHandSideMatrix92 = DN(0,0)*crLeftHandSideMatrix35;
        const double crLeftHandSideMatrix93 = DN(0,0)*crLeftHandSideMatrix56;
        const double crLeftHandSideMatrix94 = DN(0,0)*crLeftHandSideMatrix36;
        const double crLeftHandSideMatrix95 = DN(0,0)*crLeftHandSideMatrix57;
        const double crLeftHandSideMatrix96 = DN(0,1)*crLeftHandSideMatrix50;
        const double crLeftHandSideMatrix97 = DN(0,1)*crLeftHandSideMatrix51;
        const double crLeftHandSideMatrix98 = DN(0,1)*crLeftHandSideMatrix49;
