template<>
void TotalLagrangianMixedVolumetricStrainElement<2>::CalculateRightHandSide(
    VectorType& rRightHandSideVector,
    const ProcessInfo& rCurrentProcessInfo)
{
    const auto& r_geometry = GetGeometry();

    // Check RHS size
    if (rRightHandSideVector.size() != LocalSize) {
        rRightHandSideVector.resize(LocalSize, false);
    }

    // Create the kinematics container and fill the nodal data
    KinematicVariables kinematic_variables;
    for (IndexType i_node = 0; i_node < NumNodes; ++i_node) {
        const auto& r_disp = r_geometry[i_node].FastGetSolutionStepValue(DISPLACEMENT);
        for (IndexType d = 0; d < 2; ++d) {
            kinematic_variables.Displacements(i_node, d) = r_disp[d];
        }
        kinematic_variables.JacobianDeterminant[i_node] = r_geometry[i_node].FastGetSolutionStepValue(VOLUMETRIC_STRAIN);
    }

    // Create the constitutive variables and values containers
    ConstitutiveVariables constitutive_variables;
    ConstitutiveLaw::Parameters cons_law_values(r_geometry, GetProperties(), rCurrentProcessInfo);
    auto& r_cons_law_options = cons_law_values.GetOptions();
    r_cons_law_options.Set(ConstitutiveLaw::COMPUTE_STRESS, true);
    r_cons_law_options.Set(ConstitutiveLaw::USE_ELEMENT_PROVIDED_STRAIN, true);
    r_cons_law_options.Set(ConstitutiveLaw::COMPUTE_CONSTITUTIVE_TENSOR, true);

    // Calculate the RHS and LHS contributions
    rRightHandSideVector.clear();

    // Calculate stabilization constant
    const double c_tau_u = 2.0;
    const double c_tau_th = 0.1;
    const double h = ElementSizeCalculator<2,NumNodes>::AverageElementSize(r_geometry);
    const double aux_tau = c_tau_u * std::pow(h,2) / 2.0;

    // Set the auxiliary references matching the automatic differentiation symbols
    array_1d<double,3> b_gauss;
    const auto& N = kinematic_variables.N;
    const auto& DN = kinematic_variables.DN_DX;
    const auto& u = kinematic_variables.Displacements;
    const auto& th = kinematic_variables.JacobianDeterminant;
    const auto& S = constitutive_variables.StressVector;
    const auto& C = constitutive_variables.ConstitutiveMatrix;

    // RHS assembly
    const SizeType n_gauss = r_geometry.IntegrationPointsNumber(GetIntegrationMethod());
    const auto& r_integration_points = r_geometry.IntegrationPoints(GetIntegrationMethod());
    for (IndexType i_gauss = 0; i_gauss < n_gauss; ++i_gauss) {
        // Calculate kinematics
        CalculateKinematicVariables(kinematic_variables, i_gauss, GetIntegrationMethod());
        const double w_g = kinematic_variables.detJ0 * r_integration_points[i_gauss].Weight();

        // Calculate the constitutive response
        CalculateConstitutiveVariables(
            kinematic_variables,
            constitutive_variables,
            cons_law_values,
            i_gauss,
            r_geometry.IntegrationPoints(this->GetIntegrationMethod()),
            ConstitutiveLaw::StressMeasure_PK2);

        // Calculate body force
        // Note that this already includes the density computed in the reference configuration
        b_gauss = StructuralMechanicsElementUtilities::GetBodyForce(*this, r_integration_points, i_gauss);

        // Calculate the stabilization constants
        const double kappa = CalculateBulkModulus(constitutive_variables.ConstitutiveMatrix); // Equivalent bulk modulus
        const double mu = std::min(CalculateShearModulus(constitutive_variables.ConstitutiveMatrix), mMinShearModulusVector[i_gauss]); // 2nd Lame constant (shear modulus)
        mMinShearModulusVector[i_gauss] = mu; // Save the current 2nd Lame constant for the next iteration checks (note that we use the minimum historical value)
        const double tau_u = aux_tau / mu;
        const double tau_th = (c_tau_th * mu) / (mu + kappa);

        // Calculate and add the RHS Gauss point contribution
        const double crRightHandSideVector0 = DN(0,1)*u(0,0);
        const double crRightHandSideVector1 = DN(1,1)*u(1,0);
        const double crRightHandSideVector2 = DN(2,1)*u(2,0);
        const double crRightHandSideVector3 = crRightHandSideVector0 + crRightHandSideVector1 + crRightHandSideVector2;
        const double crRightHandSideVector4 = DN(0,0)*u(0,0);
        const double crRightHandSideVector5 = DN(1,0)*u(1,0);
        const double crRightHandSideVector6 = DN(2,0)*u(2,0);
        const double crRightHandSideVector7 = crRightHandSideVector4 + crRightHandSideVector5 + crRightHandSideVector6;
        const double crRightHandSideVector8 = crRightHandSideVector7 + 1;
        const double crRightHandSideVector9 = S[0]*crRightHandSideVector8 + S[2]*crRightHandSideVector3;
        const double crRightHandSideVector10 = S[1]*crRightHandSideVector3 + S[2]*crRightHandSideVector8;
        const double crRightHandSideVector11 = DN(0,0)*u(0,1);
        const double crRightHandSideVector12 = DN(1,0)*u(1,1);
        const double crRightHandSideVector13 = DN(2,0)*u(2,1);
        const double crRightHandSideVector14 = crRightHandSideVector11 + crRightHandSideVector12 + crRightHandSideVector13;
        const double crRightHandSideVector15 = std::pow(crRightHandSideVector14, 2) + std::pow(crRightHandSideVector8, 2);
        const double crRightHandSideVector16 = DN(0,1)*u(0,1);
        const double crRightHandSideVector17 = DN(1,1)*u(1,1);
        const double crRightHandSideVector18 = DN(2,1)*u(2,1);
        const double crRightHandSideVector19 = crRightHandSideVector16 + crRightHandSideVector17 + crRightHandSideVector18;
        const double crRightHandSideVector20 = crRightHandSideVector19 + 1;
        const double crRightHandSideVector21 = std::pow(crRightHandSideVector20, 2) + std::pow(crRightHandSideVector3, 2);
        const double crRightHandSideVector22 = 2*crRightHandSideVector14*crRightHandSideVector20 + 2*crRightHandSideVector3*crRightHandSideVector8;
        const double crRightHandSideVector23 = C(0,0)*crRightHandSideVector15 + C(0,1)*crRightHandSideVector21 + C(0,2)*crRightHandSideVector22;
        const double crRightHandSideVector24 = DN(0,0)*crRightHandSideVector23;
        const double crRightHandSideVector25 = -crRightHandSideVector0*crRightHandSideVector12 - crRightHandSideVector0*crRightHandSideVector13 - crRightHandSideVector1*crRightHandSideVector11 - crRightHandSideVector1*crRightHandSideVector13 - crRightHandSideVector11*crRightHandSideVector2 - crRightHandSideVector12*crRightHandSideVector2 + crRightHandSideVector16*crRightHandSideVector5 + crRightHandSideVector16*crRightHandSideVector6 + crRightHandSideVector17*crRightHandSideVector4 + crRightHandSideVector17*crRightHandSideVector6 + crRightHandSideVector18*crRightHandSideVector4 + crRightHandSideVector18*crRightHandSideVector5 + crRightHandSideVector19;
        const double crRightHandSideVector26 = -N[0]*th[0] - N[1]*th[1] - N[2]*th[2] + crRightHandSideVector25 + crRightHandSideVector7;
        const double crRightHandSideVector27 = crRightHandSideVector25 + crRightHandSideVector8;
        const double crRightHandSideVector28 = 0.5*crRightHandSideVector26*tau_th/crRightHandSideVector27;
        const double crRightHandSideVector29 = C(0,2)*crRightHandSideVector15 + C(1,2)*crRightHandSideVector21 + C(2,2)*crRightHandSideVector22;
        const double crRightHandSideVector30 = DN(0,1)*crRightHandSideVector29;
        const double crRightHandSideVector31 = S[0]*crRightHandSideVector14 + S[2]*crRightHandSideVector20;
        const double crRightHandSideVector32 = S[1]*crRightHandSideVector20 + S[2]*crRightHandSideVector14;
        const double crRightHandSideVector33 = DN(0,0)*crRightHandSideVector29;
        const double crRightHandSideVector34 = C(0,1)*crRightHandSideVector15 + C(1,1)*crRightHandSideVector21 + C(1,2)*crRightHandSideVector22;
        const double crRightHandSideVector35 = DN(0,1)*crRightHandSideVector34;
        const double crRightHandSideVector36 = crRightHandSideVector26*(tau_th - 1.0);
        const double crRightHandSideVector37 = 1.0/crRightHandSideVector8;
        const double crRightHandSideVector38 = crRightHandSideVector3*crRightHandSideVector37;
        const double crRightHandSideVector39 = crRightHandSideVector14*crRightHandSideVector38;
        const double crRightHandSideVector40 = 1.0/(crRightHandSideVector20 - crRightHandSideVector39);
        const double crRightHandSideVector41 = crRightHandSideVector27*tau_u;
        const double crRightHandSideVector42 = b_gauss[1]*crRightHandSideVector40*crRightHandSideVector41;
        const double crRightHandSideVector43 = (1.0/2.0)*tau_u;
        const double crRightHandSideVector44 = crRightHandSideVector43*(DN(0,0)*th[0] + DN(1,0)*th[1] + DN(2,0)*th[2]);
        const double crRightHandSideVector45 = crRightHandSideVector43*(DN(0,1)*th[0] + DN(1,1)*th[1] + DN(2,1)*th[2]);
        const double crRightHandSideVector46 = crRightHandSideVector14*crRightHandSideVector40;
        const double crRightHandSideVector47 = crRightHandSideVector39*crRightHandSideVector40 + 1;
        const double crRightHandSideVector48 = b_gauss[0]*crRightHandSideVector37*crRightHandSideVector41;
        const double crRightHandSideVector49 = DN(1,0)*crRightHandSideVector23;
        const double crRightHandSideVector50 = DN(1,1)*crRightHandSideVector29;
        const double crRightHandSideVector51 = DN(1,0)*crRightHandSideVector29;
        const double crRightHandSideVector52 = DN(1,1)*crRightHandSideVector34;
        const double crRightHandSideVector53 = DN(2,0)*crRightHandSideVector23;
        const double crRightHandSideVector54 = DN(2,1)*crRightHandSideVector29;
        const double crRightHandSideVector55 = DN(2,0)*crRightHandSideVector29;
        const double crRightHandSideVector56 = DN(2,1)*crRightHandSideVector34;
        rRightHandSideVector[0]+=-w_g*(DN(0,0)*crRightHandSideVector9 + DN(0,1)*crRightHandSideVector10 - N[0]*b_gauss[0] + crRightHandSideVector24*crRightHandSideVector28 + crRightHandSideVector28*crRightHandSideVector30);
        rRightHandSideVector[1]+=-w_g*(DN(0,0)*crRightHandSideVector31 + DN(0,1)*crRightHandSideVector32 - N[0]*b_gauss[1] + crRightHandSideVector28*crRightHandSideVector33 + crRightHandSideVector28*crRightHandSideVector35);
        rRightHandSideVector[2]+=w_g*(N[0]*crRightHandSideVector36 - crRightHandSideVector42*(DN(0,0)*crRightHandSideVector38 - DN(0,1)) + crRightHandSideVector44*(crRightHandSideVector24 + crRightHandSideVector30) + crRightHandSideVector45*(crRightHandSideVector33 + crRightHandSideVector35) + crRightHandSideVector48*(DN(0,0)*crRightHandSideVector47 - DN(0,1)*crRightHandSideVector46));
        rRightHandSideVector[3]+=-w_g*(DN(1,0)*crRightHandSideVector9 + DN(1,1)*crRightHandSideVector10 - N[1]*b_gauss[0] + crRightHandSideVector28*crRightHandSideVector49 + crRightHandSideVector28*crRightHandSideVector50);
        rRightHandSideVector[4]+=-w_g*(DN(1,0)*crRightHandSideVector31 + DN(1,1)*crRightHandSideVector32 - N[1]*b_gauss[1] + crRightHandSideVector28*crRightHandSideVector51 + crRightHandSideVector28*crRightHandSideVector52);
        rRightHandSideVector[5]+=w_g*(N[1]*crRightHandSideVector36 - crRightHandSideVector42*(DN(1,0)*crRightHandSideVector38 - DN(1,1)) + crRightHandSideVector44*(crRightHandSideVector49 + crRightHandSideVector50) + crRightHandSideVector45*(crRightHandSideVector51 + crRightHandSideVector52) + crRightHandSideVector48*(DN(1,0)*crRightHandSideVector47 - DN(1,1)*crRightHandSideVector46));
        rRightHandSideVector[6]+=-w_g*(DN(2,0)*crRightHandSideVector9 + DN(2,1)*crRightHandSideVector10 - N[2]*b_gauss[0] + crRightHandSideVector28*crRightHandSideVector53 + crRightHandSideVector28*crRightHandSideVector54);
        rRightHandSideVector[7]+=-w_g*(DN(2,0)*crRightHandSideVector31 + DN(2,1)*crRightHandSideVector32 - N[2]*b_gauss[1] + crRightHandSideVector28*crRightHandSideVector55 + crRightHandSideVector28*crRightHandSideVector56);
        rRightHandSideVector[8]+=w_g*(N[2]*crRightHandSideVector36 - crRightHandSideVector42*(DN(2,0)*crRightHandSideVector38 - DN(2,1)) + crRightHandSideVector44*(crRightHandSideVector53 + crRightHandSideVector54) + crRightHandSideVector45*(crRightHandSideVector55 + crRightHandSideVector56) + crRightHandSideVector48*(DN(2,0)*crRightHandSideVector47 - DN(2,1)*crRightHandSideVector46));
    }
}

