        rRightHandSideVector[13]+=-w_g*(DN(3,0)*crRightHandSideVector150 + DN(3,1)*crRightHandSideVector151 + DN(3,2)*crRightHandSideVector152 - N[3]*b_gauss[1] + crRightHandSideVector145*crRightHandSideVector215 + crRightHandSideVector145*crRightHandSideVector216 + crRightHandSideVector145*crRightHandSideVector217);
