    const double cr_eq_green_strain20 = DN(2,0)*u(2,0);
    const double cr_eq_green_strain21 = cr_eq_green_strain16*cr_eq_green_strain20;
    const double cr_eq_green_strain22 = cr_eq_green_strain12*cr_eq_green_strain16;
    const double cr_eq_green_strain23 = DN(3,0)*u(3,0);
    const double cr_eq_green_strain24 = DN(0,2)*u(0,2);
    const double cr_eq_green_strain25 = cr_eq_green_strain17*cr_eq_green_strain24;
    const double cr_eq_green_strain26 = cr_eq_green_strain24*cr_eq_green_strain6;
    const double cr_eq_green_strain27 = cr_eq_green_strain20*cr_eq_green_strain24;
    const double cr_eq_green_strain28 = cr_eq_green_strain10*cr_eq_green_strain24;
    const double cr_eq_green_strain29 = cr_eq_green_strain10*cr_eq_green_strain17;
    const double cr_eq_green_strain30 = cr_eq_green_strain12*cr_eq_green_strain17;
    const double cr_eq_green_strain31 = cr_eq_green_strain20*cr_eq_green_strain6;
    const double cr_eq_green_strain32 = cr_eq_green_strain12*cr_eq_green_strain6;
    const double cr_eq_green_strain33 = cr_eq_green_strain20*cr_eq_green_strain8;
    const double cr_eq_green_strain34 = cr_eq_green_strain10*cr_eq_green_strain8;
    const double cr_eq_green_strain35 = DN(1,1)*u(1,0);
    const double cr_eq_green_strain36 = cr_eq_green_strain0*cr_eq_green_strain35;
    const double cr_eq_green_strain37 = DN(0,0)*u(0,2);
    const double cr_eq_green_strain38 = DN(1,2)*u(1,0);
    const double cr_eq_green_strain39 = cr_eq_green_strain37*cr_eq_green_strain38;
    const double cr_eq_green_strain40 = DN(2,1)*u(2,0);
    const double cr_eq_green_strain41 = cr_eq_green_strain0*cr_eq_green_strain40;
    const double cr_eq_green_strain42 = DN(2,2)*u(2,0);
    const double cr_eq_green_strain43 = cr_eq_green_strain37*cr_eq_green_strain42;
    const double cr_eq_green_strain44 = DN(3,1)*u(3,0);
    const double cr_eq_green_strain45 = cr_eq_green_strain0*cr_eq_green_strain44;
    const double cr_eq_green_strain46 = DN(3,2)*u(3,0);
    const double cr_eq_green_strain47 = cr_eq_green_strain37*cr_eq_green_strain46;
    const double cr_eq_green_strain48 = DN(0,1)*u(0,0);
    const double cr_eq_green_strain49 = cr_eq_green_strain1*cr_eq_green_strain48;
    const double cr_eq_green_strain50 = DN(0,1)*u(0,2);
    const double cr_eq_green_strain51 = DN(1,2)*u(1,1);
    const double cr_eq_green_strain52 = cr_eq_green_strain50*cr_eq_green_strain51;
    const double cr_eq_green_strain53 = cr_eq_green_strain2*cr_eq_green_strain48;
    const double cr_eq_green_strain54 = DN(2,2)*u(2,1);
    const double cr_eq_green_strain55 = cr_eq_green_strain50*cr_eq_green_strain54;
    const double cr_eq_green_strain56 = cr_eq_green_strain3*cr_eq_green_strain48;
